import React from 'react';
import ReactDOM from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail'

const App = () => {
    return (
        <div className="ui container comments">
            <CommentDetail author="Sam" timeAgo="today at 4:45PM" content="Nice blog post" />
            <CommentDetail author="Alex" timeAgo="today at 6:00PM" content="I like blog subject" />
            <CommentDetail author="Jane" timeAgo="today at 7:30PM" content="I like the writing" />
        </div>
    );
}

ReactDOM.render(<App />, document.querySelector('#root'));
